import React from 'react';



function add(a,b){
    let sum  = a+b;
    return sum;
    let div = a-b;
    return div;
}
function sub(a,b){
    let sum  = a-b;
    return sum;
}
function mul(a,b){
    let sum  = a*b;
    return sum;
}
function div(a,b){
    let sum  = a/b;
    return sum;
}


export {add , sub , mul , div};
